import React from "react";
import { Form, Input } from "antd";

const RememberPassword = () => {
  return (
    <Form hideRequiredMark>
      <Form.Item
        name="email"
        label="Email"
        rules={[{ required: true, type: "email", message: "Enter email" }]}
      >
        <Input />
      </Form.Item>
    </Form>
  );
};

export default RememberPassword;
